import{_ as e,o as t,c as o,ae as r}from"./chunks/framework.D5T0pHrq.js";const g=JSON.parse('{"title":"Описание товарного знака «Вокзал.ТЕХ»","description":"","frontmatter":{},"headers":[],"relativePath":"legal/rospatent/templates/opisanie-tovarnogo-znaka.md","filePath":"legal/rospatent/templates/opisanie-tovarnogo-znaka.md"}'),n={name:"legal/rospatent/templates/opisanie-tovarnogo-znaka.md"};function s(l,a,i,p,h,d){return t(),o("div",null,[...a[0]||(a[0]=[r('<h1 id="описание-товарного-знака-«вокзал-тех»" tabindex="-1">Описание товарного знака «Вокзал.ТЕХ» <a class="header-anchor" href="#описание-товарного-знака-«вокзал-тех»" aria-label="Permalink to &quot;Описание товарного знака «Вокзал.ТЕХ»&quot;">​</a></h1><p><em>Текст для копирования в заявку на регистрацию товарного знака (пункт «Описание обозначения»).</em></p><hr><h2 id="общие-сведения" tabindex="-1">Общие сведения <a class="header-anchor" href="#общие-сведения" aria-label="Permalink to &quot;Общие сведения&quot;">​</a></h2><p>Комбинированное обозначение «Вокзал.ТЕХ» представляет собой словесно-изобразительный товарный знак, состоящий из словесной и изобразительной частей.</p><hr><h2 id="_1-словесная-часть" tabindex="-1">1. Словесная часть <a class="header-anchor" href="#_1-словесная-часть" aria-label="Permalink to &quot;1. Словесная часть&quot;">​</a></h2><p><strong>Словесный элемент</strong>: «ВОКЗАЛ» (кириллица), выполненный стилизованным современным геометрическим шрифтом без засечек (sans-serif) синего цвета (Pantone 286 C, аналог HEX #2563EB).</p><p><strong>Дополнительный словесный элемент</strong>: «.ТЕХ» (кириллица), выполненный в едином стиле с основным словесным элементом, подчёркивающий технологическую направленность бренда.</p><p><strong>Смысловое значение</strong>: обозначение ассоциируется с автовокзалом и современными технологиями в сфере пассажирских перевозок и продажи билетов.</p><hr><h2 id="_2-изобразительная-часть" tabindex="-1">2. Изобразительная часть <a class="header-anchor" href="#_2-изобразительная-часть" aria-label="Permalink to &quot;2. Изобразительная часть&quot;">​</a></h2><p><strong>Основной элемент</strong>: стилизованное изображение автобуса, выполненное в современной манере. Кузов автобуса представлен в комбинации тёмно-синего и оранжевого цветов.</p><p><strong>Технологические элементы</strong>: вокруг и в составе изображения автобуса размещены линии и точки, напоминающие элементы электронных схем или цифровой сети, что символизирует интеграцию транспорта и информационных технологий.</p><p><strong>Дополнительный элемент</strong>: изображение планшетного устройства или экрана с интерфейсом (схематично), расположенное в зоне передней части автобуса, обозначает электронные билеты и цифровые сервисы.</p><p><strong>Динамика</strong>: присутствуют визуальные элементы (линии, стрелка), передающие направление движения и развитие.</p><hr><h2 id="_3-цветовое-решение" tabindex="-1">3. Цветовое решение <a class="header-anchor" href="#_3-цветовое-решение" aria-label="Permalink to &quot;3. Цветовое решение&quot;">​</a></h2><ul><li><strong>Синий</strong> (основной): HEX #2563EB, Pantone 286 C — надёжность, технологичность, профессионализм. Используется для верхней части автобуса, словесной части «ВОКЗАЛ» и части цифровых элементов.</li><li><strong>Оранжевый</strong>: HEX #F59E0B, Pantone 137 C — энергия, движение, современность. Используется для нижней части автобуса, акцентных линий и элементов интерфейса.</li><li><strong>Белый</strong>: используется для световых элементов (фары, блики), текста и элементов на экране устройства.</li></ul><p>При регистрации в чёрно-белом варианте обозначение сохраняет различительную способность за счёт контраста и силуэта.</p><hr><h2 id="_4-композиция" tabindex="-1">4. Композиция <a class="header-anchor" href="#_4-композиция" aria-label="Permalink to &quot;4. Композиция&quot;">​</a></h2><p>Изобразительная часть (автобус с технологическими элементами) располагается над словесной частью «ВОКЗАЛ». Элементы образуют единую композицию, воспринимаемую как один товарный знак. Обозначение предназначено для использования в качестве средства индивидуализации товаров и услуг в сфере программного обеспечения, автоматизации автовокзалов, продажи билетов и сопутствующих услуг.</p><hr><h2 id="_5-указание-на-вид-обозначения" tabindex="-1">5. Указание на вид обозначения <a class="header-anchor" href="#_5-указание-на-вид-обозначения" aria-label="Permalink to &quot;5. Указание на вид обозначения&quot;">​</a></h2><p>Товарный знак является комбинированным (словесно-изобразительным), заявляется в цвете. Графическое представление прилагается к заявке (файл изображения: использовать <code>vokzal-logo.png</code> из корня проекта; для подачи в ФИПС при необходимости конвертировать в JPEG, разрешение не менее 300 dpi, размер не менее 8×8 см).</p>',26)])])}const c=e(n,[["render",s]]);export{g as __pageData,c as default};
